import React from 'react';
import { Inviter, SessionState, UserAgent } from "sip.js";

function Phone(props) {

    const userAgent = new UserAgent({
        uri: UserAgent.makeURI("sip:6666@odricomt2.odricall.com"),
        transportOptions: {
            server: "wss://webrtc2.odricall.com:8443"
        },
    });

    // Connect the user agent
    userAgent.start().then(() => {

        // Set target destination (callee)
        const target = UserAgent.makeURI("sip:0534217014@odricomt2.odricall.com");
        if (!target) {
        throw new Error("Failed to create target URI.");
        }

        // Create a user agent client to establish a session
        const inviter = new Inviter(userAgent, target, {
        sessionDescriptionHandlerOptions: {
            constraints: { audio: true, video: false }
        }
        });

        // Handle outgoing session state changes
        inviter.stateChange.addListener((newState) => {
        switch (newState) {
            case SessionState.Establishing:
            // Session is establishing
            console.info('Session is establishing');
            break;
            case SessionState.Established:
            // Session has been established
            console.info('Session has been established');
            break;
            case SessionState.Terminated:
                console.info('Session has terminated');
            // Session has terminated
            break;
            default:
            break;
        }
        });

        // Send initial INVITE request
        inviter.invite()
        .then((t) => {
            console.log(t);
            // INVITE sent
        })
        .catch((error) => {
            console.log(error);
            // INVITE did not send
        });

    });


    return (
        <div>

        </div>
    );
}

export default Phone;
